import React from 'react'
import Ecom from "./Ecom.js";


export default function home() {
    var isLoggedIn = JSON.parse(Ecom.getCookie("session-member-record"));
    if(isLoggedIn!=""){
        return (
            <h1>Home</h1>
        )
    }else{
        window.location.href ="/login";
    }

}
